import React from 'react'

function Sidebar() {
    return (
        <div className="w-[64px] h-screen bg-slate-800 text-white fixed">
            <div className="mx-1.5 my-2">
                <img src="https://joeschmoe.io/api/v1/random"
                    className="w-14 h-14 rounded-full object-cover object-center border-2"
                    alt="avt" />
            </div>
        </div>
    )
}

export default Sidebar
